import React, { useState } from "react";
import SubmitButton from "./SubmitButton.js";

function App() {
  const [clicked, setClicked] = useState(false);

  return clicked ? (
    alert("The button is clicked")
  ) : (
    <SubmitButton onClick={() => setClicked(true)} />
  );
}

export default App;
